public void printDetails(final PrintStream out) {
  out.print(this + ", entries = [");
  for (int i = 0; i < entries.length; i++) {
    if (entries[i] != null) {
      LinkedElement<T> e = entries[i];
      out.print("\n  " + i + ": " + e);
      for (e = e.next; e != null; e = e.next) {
        out.print(" -> " + e);
      }
    }
  }
  out.println("\n]");
}
